"use strict";(self.webpackChunkcigra_wiki=self.webpackChunkcigra_wiki||[]).push([[22984],{182213:(e,n,a)=>{a.r(n),a.d(n,{assets:()=>l,contentTitle:()=>i,default:()=>g,frontMatter:()=>o,metadata:()=>d,toc:()=>t});const d=JSON.parse('{"id":"brand/el-rey-del-mundo","title":"el-rey-del-mundo","description":"","source":"@site/docs/brand/el-rey-del-mundo.md","sourceDirName":"brand","slug":"/brand/el-rey-del-mundo","permalink":"/brand/el-rey-del-mundo","draft":false,"unlisted":false,"tags":[],"version":"current","frontMatter":{},"sidebar":"brandSidebar","previous":{"title":"El Rey del Mundo","permalink":"/brand/el-rey-del-mundo/bands"},"next":{"title":"Flor del Punto","permalink":"/brand/flordelpunto"}}');var r=a(474848),s=a(28453);const o={},i=void 0,l={},t=[];function u(e){const n={code:"code",pre:"pre",...(0,s.R)(),...e.components};return(0,r.jsx)(n.pre,{children:(0,r.jsx)(n.code,{className:"language-markdown",children:'---\nid: el-rey-del-mundo\ntitle: El Rey del Mundo\n---\n\n[![El Rey del Mundo Logo](/img/brandlogos/el-rey-del-mundo-_442x400.jpg)](/img/brandlogos/el-rey-del-mundo-.jpg)\n\n### Brand Notes\n\n**Status**  \nEl Rey del Mundo is a current pre-revolution brand, established in 1882.\n\n**Generally**  \nIt is classified by Habanos SA in their Other category of portfolio brands. The range comprises light to medium strength cigars using tobacco from the premium _Vuelta Abajo_ region. There is a non-Cuban brand with the same name.\n\n[![Standard Band A Image](/img/brandbands/el-rey-del-mundo-standard-band-a_800x224.jpg)](/img/brandbands/el-rey-del-mundo-standard-band-a.jpg)  \n**Standard Band A**  \n1960s on -- Current? Embossed.\n\n[![Standard Band B Image](/img/brandbands/el-rey-del-mundo-standard-band-b_800x226.jpg)](/img/brandbands/el-rey-del-mundo-standard-band-b.jpg)  \n**Standard Band B**  \n2007 on for Special Releases -- Current. c2010/11 on for Standard Production -- Current. Detailed embossing.\n\n[Full Band Gallery](/brand/el-rey-del-mundo/bands)\n\n## Current Production Cigars\n\n### El Rey del Mundo [Choix Supr\xeame](/cigar/el-rey-del-mundo/choix-supreme)\n- **Size**: 48 \xd7 127 mm (5")\n- **Type**: Hermosos No.4\n- **Construction**: Handmade\n- **Bands**: B25 - Standard bands A, B. SLB50 - no bands until c2005, then standard band A.\n- **Packaging**: Dress box of 25 cigars. Slide lid box of 50 cigars (discontinued 2010).\n- **Status**: Pre-1960 release. 1960-01-01 Current.\n\n[![El Rey del Mundo Choix Supr\xeame](/img/cigars/el-rey-del-mundo-choix-supreme2_762x120.jpg)](/img/cigars/el-rey-del-mundo-choix-supreme2.jpg)\n\n### El Rey del Mundo [Demi Tasse](/cigar/el-rey-del-mundo/demi-tasse)\n- **Size**: 30 \xd7 100 mm (3\u215e")\n- **Type**: Entreactos\n- **Construction**: Handmade\n- **Bands**: B25 - Standard bands A, B. SLB25 - No bands.\n- **Packaging**: Dress box of 25 cigars. Slide lid box of 25 cigars (discontinued pre-2003).\n- **Status**: Pre-1960 release. 1960-01-01 Current.\n\n[![El Rey del Mundo Demi Tasse](/img/cigars/el-rey-del-mundo-demi-tasse2_600x80.jpg)](/img/cigars/el-rey-del-mundo-demi-tasse2.jpg)\n\n### El Rey del Mundo [Royal Series La Casa del Habano Exclusivo](/cigar/el-rey-del-mundo/la-casa-del-habano-exclusivo)\n- **Size**: 50 \xd7 155 mm (6\u215b")\n- **Type**: Dobles\n- **Construction**: Handmade\n- **Bands**: Standard band B, with a La Casa del Habano Exclusive band.\n- **Packaging**: Luxury bo\xeete nature box of 20 cigars.\n- **Status**: 2022 release. 2022-01-01 Current. Released late-2023.\n\n[![El Rey del Mundo Royal Series](/img/cigars/el-rey-del-mundo-royal-series1_930x130.jpg)](/img/cigars/el-rey-del-mundo-royal-series1.jpg)  \n[![El Rey del Mundo Royal Series Packaging](/img/cigarpackaging/el-rey-del-mundo-royal-series5_422x300.jpg)](/img/cigarpackaging/el-rey-del-mundo-royal-series5.jpg)  \n[![El Rey del Mundo Royal Series Packaging](/img/cigarpackaging/el-rey-del-mundo-royal-series7_254x300.jpg)](/img/cigarpackaging/el-rey-del-mundo-royal-series7.jpg)\n\n## Discontinued Production Cigars\n\n### El Rey del Mundo [Petit Coronas](/cigar/el-rey-del-mundo/petit-coronas)\n- **Size**: 42 \xd7 129 mm (5\u215b")\n- **Type**: Marevas\n- **Construction**: Handmade\n- **Bands**: B25s - Standard band A. SLBs - No bands.\n- **Packaging**: Dress box of 25 cigars (discontinued 2012). Slide lid box of 50 cigars (discontinued c2003). Dress box of 25 cigars in cellophane (discontinued pre-2000). Slide lid box of 25 cigars (discontinued pre-2000). Humidor of 100 cigars (discontinued pre-2000).\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 2012.\n\n[![El Rey del Mundo Petit Coronas](/img/cigars/el-rey-del-mundo-petit-coronas_774x96.jpg)](/img/cigars/el-rey-del-mundo-petit-coronas.jpg)\n\n### El Rey del Mundo [Grandes de Espa\xf1a](/cigar/el-rey-del-mundo/grandes-de-espana)\n- **Size**: 38 \xd7 192 mm (7\xbd")\n- **Type**: Delicados\n- **Construction**: Handmade\n- **Bands**: B25, B50at - Standard Band A. SLB25 - No bands.\n- **Packaging**: Dress box of 25 cigars (discontinued 2010). Slide lid box of 25 cigars (discontinued pre-2002). Dress box of 50 cigars in aluminium tubes (discontinued pre-1997).\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 2010.\n\n[![El Rey del Mundo Grandes de Espa\xf1a](/img/cigars/el-rey-del-mundo-grandes-de-espana_1152x90.jpg)](/img/cigars/el-rey-del-mundo-grandes-de-espana.jpg)\n\n### El Rey del Mundo [Lunch Club](/cigar/el-rey-del-mundo/lunch-club)\n- **Size**: 40 \xd7 116 mm (4\u215d")\n- **Type**: Franciscanos\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 25 cigars.\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 2009.\n\n[![El Rey del Mundo Lunch Club](/img/cigars/el-rey-del-mundo-lunch-club_696x94.jpg)](/img/cigars/el-rey-del-mundo-lunch-club.jpg)\n\n### El Rey del Mundo [Coronas de Luxe](/cigar/el-rey-del-mundo/coronas-de-luxe)\n- **Size**: 42 \xd7 142 mm (5\u215d")\n- **Type**: Coronas\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 25 cigars (discontinued 2006). Slide lid box of 50 cigars (discontinued pre-2002). Humidor of 100 cigars (discontinued pre-2000).\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 2006.\n\n[![El Rey del Mundo Coronas de Luxe](/img/cigars/el-rey-del-mundo-coronas-de-luxe_852x102.jpg)](/img/cigars/el-rey-del-mundo-coronas-de-luxe.jpg)\n\n### El Rey del Mundo [Ta\xednos](/cigar/el-rey-del-mundo/tainos)\n- **Size**: 47 \xd7 178 mm (7")\n- **Type**: Julieta No.2\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Slide lid box of 25 cigars (discontinued 2006). Slide lid box of 50 cigars (discontinued pre-2000). Semi bo\xeete nature box of 50 cigars (discontinued pre-2000).\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 2006.\n\n[![El Rey del Mundo Ta\xednos](/img/cigars/el-rey-del-mundo-tainos3_1068x120.jpg)](/img/cigars/el-rey-del-mundo-tainos3.jpg)\n\n### El Rey del Mundo [Petit Lonsdales](/cigar/el-rey-del-mundo/petit-lonsdales)\n- **Size**: 42 \xd7 129 mm (5\u215b")\n- **Type**: Marevas\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 25 cigars. Slide lid box of 25 cigars.\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 2003.\n\n[![El Rey del Mundo Petit Lonsdales](/img/cigars/el-rey-del-mundo-petit-lonsdales_774x104.jpg)](/img/cigars/el-rey-del-mundo-petit-lonsdales.jpg)\n\n### El Rey del Mundo [Elegantes](/cigar/el-rey-del-mundo/elegantes)\n- **Size**: 28 \xd7 175 mm (6\u215e")\n- **Type**: Panetelas Largas\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 25 cigars (discontinued 2002). Slide lid box of 25 cigars (discontinued pre-2002).\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 2002.\n\n[![El Rey del Mundo Elegantes](/img/cigars/el-rey-del-mundo-elegantes2_1050x88.jpg)](/img/cigars/el-rey-del-mundo-elegantes2.jpg)\n\n### El Rey del Mundo [Gran Coronas](/cigar/el-rey-del-mundo/gran-coronas)\n- **Size**: 46 \xd7 143 mm (5\u215d")\n- **Type**: Coronas Gordas\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 25 cigars. Slide lid box of 25 cigars. Slide lid box of 50 cigars.\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 2002.\n\n[![El Rey del Mundo Gran Coronas](/img/cigars/el-rey-del-mundo-gran-coronas2_858x112.jpg)](/img/cigars/el-rey-del-mundo-gran-coronas2.jpg)\n\n### El Rey del Mundo [Lonsdales](/cigar/el-rey-del-mundo/lonsdales)\n- **Size**: 42 \xd7 165 mm (6\xbd")\n- **Type**: Cervantes\n- **Construction**: Handmade\n- **Bands**: SLBs - no bands. B25 - standard band A.\n- **Packaging**: Dress box of 25 cigars (discontinued 2002). Slide lid box of 25 cigars (discontinued pre-2002).\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 2002.\n\n[![El Rey del Mundo Lonsdales](/img/cigars/el-rey-del-mundo-lonsdales2_990x104.jpg)](/img/cigars/el-rey-del-mundo-lonsdales2.jpg)\n\n### El Rey del Mundo [Tr\xe8s Petit Coronas](/cigar/el-rey-del-mundo/tres-petit-coronas)\n- **Size**: 42 \xd7 110 mm (4\u215c")\n- **Type**: Minutos\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 25 cigars.\n- **Status**: 1995 release. 1995-01-01 Discontinued 1999.\n\n[![El Rey del Mundo Tr\xe8s Petit Coronas](/img/cigars/el-rey-del-mundo-tres-petit-coronas_660x94.jpg)](/img/cigars/el-rey-del-mundo-tres-petit-coronas.jpg)\n\n### El Rey del Mundo [Panetelas Largas](/cigar/el-rey-del-mundo/panetelas-largas)\n- **Size**: 28 \xd7 175 mm (6\u215e")\n- **Type**: Panetelas Largas\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 10 cigars. Dress box of 10 cigars in cellophane. Dress box of 25 cigars in cellophane. Dress box of 25 cigars. Slide lid box of 25 cigars.\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 1990s.\n\n[![El Rey del Mundo Panetelas Largas](/img/cigars/el-rey-del-mundo-panetelas-largas_1050x70.jpg)](/img/cigars/el-rey-del-mundo-panetelas-largas.jpg)\n\n### El Rey del Mundo [Isabel](/cigar/el-rey-del-mundo/isabel)\n- **Size**: 35 \xd7 143 mm (5\u215d")\n- **Type**: Carlotas\n- **Construction**: Handmade\n- **Bands**: SLBs - no bands. B25 - standard band A.\n- **Packaging**: Dress box of 25 cigars (discontinued 1985). Slide lid box of 25 cigars (discontinued pre-1985). Slide lid box of 50 cigars (discontinued 1985).\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 1985.\n\n[![El Rey del Mundo Isabel](/img/cigars/el-rey-del-mundo-isabel_858x84.jpg)](/img/cigars/el-rey-del-mundo-isabel.jpg)\n\n### El Rey del Mundo [Se\xf1oritas](/cigar/el-rey-del-mundo/senoritas)\n- **Size**: 26 \xd7 115 mm (4\xbd")\n- **Type**: Laguito No.3\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Slide lid box of 25 cigars. Dress box of 50 cigars.\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 1980s.\n\n[![El Rey del Mundo Se\xf1oritas](/img/cigars/el-rey-del-mundo-senoritas_690x66.jpg)](/img/cigars/el-rey-del-mundo-senoritas.jpg)\n\n### El Rey del Mundo [Variedades](/cigar/el-rey-del-mundo/variedades)\n- **Size**: 29 \xd7 106 mm (4\u215b")\n- **Type**: Chicos\n- **Construction**: Machine-made\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 25 cigars in cellophane. Dress box of 25 cigars.\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 1980s.\n\n[![El Rey del Mundo Variedades](/img/cigartubes/el-rey-del-mundo-variedades_642x70.jpg)](/img/cigartubes/el-rey-del-mundo-variedades.jpg)\n\n### El Rey del Mundo [Epicures](/cigar/el-rey-del-mundo/epicures)\n- **Size**: 29 \xd7 130 mm (5\u215b")\n- **Type**: Unknown\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 25 cigars.\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 1970s.\n\n[![El Rey del Mundo Epicures](/img/cigars/el-rey-del-mundo-epicures_780x76.jpg)](/img/cigars/el-rey-del-mundo-epicures.jpg)\n\n### El Rey del Mundo [Royal Series No.2](/cigar/el-rey-del-mundo/royal-series-no2)\n- **Size**: 42 \xd7 129 mm (5\u215b")\n- **Type**: Unknown\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 25 cigars.\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 1970s.\n\n[![El Rey del Mundo Royal Series No.2](/img/cigars/el-rey-del-mundo-royal-series-no2_774x104.jpg)](/img/cigars/el-rey-del-mundo-royal-series-no2.jpg)\n\n### El Rey del Mundo [Royal Series No.3](/cigar/el-rey-del-mundo/royal-series-no3)\n- **Size**: 40 \xd7 110 mm (4\u215c")\n- **Type**: Unknown\n- **Construction**: Handmade\n- **Bands**: Standard band A.\n- **Packaging**: Dress box of 25 cigars.\n- **Status**: Pre-1960 release. 1960-01-01 Discontinued 1970s.\n\n[![El Rey del Mundo Royal Series No.3](/img/cigars/el-rey-del-mundo-royal-series-no3_660x98.jpg)](/img/cigars/el-rey-del-mundo-royal-series-no3.jpg)\n\n## Special Releases\n\n### El Rey del Mundo [120 Aniversario Humidor](/cigar/el-rey-del-mundo/120-aniversario-humidor)\n- **Size**: 52 \xd7 156 mm (6\u215b")\n- **Type**: Pir\xe1mides\n- **Construction**: Handmade\n- **Bands**: Humidors 001 to 120 - Standard band A. Humidors 121 to 220 - Standard band A, with La Casa del Habano band.\n- **Packaging**: Numbered humidor of 50 cigars (220 produced).\n- **Status**: 2004 release\n'})})}function g(e={}){const{wrapper:n}={...(0,s.R)(),...e.components};return n?(0,r.jsx)(n,{...e,children:(0,r.jsx)(u,{...e})}):u(e)}},28453:(e,n,a)=>{a.d(n,{R:()=>o,x:()=>i});var d=a(296540);const r={},s=d.createContext(r);function o(e){const n=d.useContext(s);return d.useMemo((function(){return"function"==typeof e?e(n):{...n,...e}}),[n,e])}function i(e){let n;return n=e.disableParentContext?"function"==typeof e.components?e.components(r):e.components||r:o(e.components),d.createElement(s.Provider,{value:n},e.children)}}}]);